function Footer(){
    return (
        <footer className='bg-gray-100 text-center p-1 absolute bottom-0 w-full flex p-3 justify-between'>
            <div className= " flex  justify-between bg-gray-400">
                <h3 className="font-bold mr-1 p-1">NEWSLETTER SIGN</h3>
                <input className="p-1" type="email" placeholder="Enter Your Email" />
            </div>

        </footer>  

    )
}

export default Footer
